/**
 * @typedef {Object} Gnop.Player
 * @property {string} sessionUuid
 * @property {string} state
 * @property {string} name
 * @property {number} number
 * @property {number} hp
 */

/**
 * @typedef {Object} Gnop.Position
 * @property {number} x
